            "following_url": "https://api.github.com/users/kiddkai/following{/other_user}",
            "gists_url": "https://api.github.com/users/kiddkai/gists{/gist_id}",
            "starred_url": "https://api.github.com/users/kiddkai/starred{/owner}{/repo}",
            "subscriptions_url": "https://api.github.com/users/kiddkai/subscriptions",
            "organizations_url": "https://api.github.com/users/kiddkai/orgs",
            "repos_url": "https://api.github.com/users/kiddkai/repos",
            "events_url": "https://api.github.com/users/kiddkai/events{/privacy}",
            "received_events_url": "https://api.github.com/users/kiddkai/received_events",
