          "closed_at": "2015-06-25T21:08:02Z",
          "body": "heres an easy one, i always hate typing this one out:\r\n\r\n - atLeast (cnt, value, array) returns bool\r\n - atMost (cnt, value, array)  returns bool\r\n\r\nexample:\r\n\r\n    animals = [ 'cat','dog','bear','cat' ]\r\n    if (_atLeast(2, 'cat', animals))\r\n      feedcats()\r\n\r\n\r\nreplaces\r\n\r\n    animals = ['cat','dog','bear','cat']\r\n    cnt = 0;\r\n    for (animal of animals){\r\n      if (animal == 'cat'){\r\n        cnt += 1\r\n      }\r\n    }\r\n    if (cnt > 2){\r\n         feedcats()\r\n    }\r\n"
