          "body": "I'm comparing two objects using this code, to ignore properties starting with $:\r\n\r\n```\r\nfunction areElementEquals (leftElement, rightElement) {\r\n\tfunction customComparer (left, right, key) {\r\n\t\tif (_(key).startsWith('$'))\r\n\t\t\treturn true;\r\n\r\n\t\tif (_.isObject(left))\r\n\t\t\treturn _.isEqual(left, right, customComparer);\r\n\r\n\t\treturn left === right;\r\n\t}\r\n\r\n\treturn _.isEqual(leftElement, rightElement, customComparer);\r\n}\r\n```\r\n\r\nThe customComparer never receive the third argument (key) as the documentation says it should: https://lodash.com/docs#isEqual"
