            "starred_url": "https://api.github.com/users/jiaweihli/starred{/owner}{/repo}",
            "subscriptions_url": "https://api.github.com/users/jiaweihli/subscriptions",
            "organizations_url": "https://api.github.com/users/jiaweihli/orgs",
            "repos_url": "https://api.github.com/users/jiaweihli/repos",
            "events_url": "https://api.github.com/users/jiaweihli/events{/privacy}",
