          "body": "I just noticed that passing an undefined for `_.indexOf` when binary search returned something different without binary search.\r\n\r\n```\r\n// this returns -1\r\n_.indexOf([1,2,3,4,5,6], undefined);\r\n\r\n// this returns 6\r\n_.indexOf([1,2,3,4,5,6], undefined, true);\r\n```\r\n\r\nwas this intended behavior?"
