          "body": "This pull request allows `_.ary` to take an extra argument, which when true, creates a wrapper function that has the exact right arity.\r\n\r\n```js\r\n_.ary(fn, 5).length === 5\r\n```\r\n\r\nThere's are a couple of JS libraries where function arity is important (Express, for instance)."
