          "body": "Hey, since lodash includes a `_.escapeRegExp` function. Currently we're specifying `RegExp.escape` feature for JavaScript and we could use your experience and expertise on the subject and would like to invite you to participate in the discussion and the process.\r\n\r\nhttps://github.com/benjamingr/RegExp.escape is the repo. Please do not hesitate to open issue.\r\n\r\n@jdalton I apologize for the noise I know you guys hate open issues - I'll close this in a week :) Feel free to close sooner if this bothers you. "
